import React from 'react';
import BottomBanner from '../components/BottomBanner';
import Services from '../components/Services';

const Home = () => {
  return (
    <React.Fragment>
      <h1>Homepage</h1>
      <Services />
      <BottomBanner />
    </React.Fragment>
  )
};

export default Home;
